import { makeStyles } from "@mui/styles";

import { IMovie } from "../../../interfaces/movieInterface";

export const CarouselItem = (movie: IMovie) => {
  const classes = useStyles();
  return (
    <div>
      <img
        src={movie.imageUrl}
        className={classes.image}
        alt="bild saknas"
      ></img>
    </div>
  );
};

const useStyles = makeStyles((theme) => ({
  image: {
    width: "100%",
  },
}));
